import 'bootstrap/dist/js/bootstrap.bundle.min';
import '@fortawesome/fontawesome-free/css/all.min.css';
import './style.css';
import Button from '@mui/material/Button';
import React, {location} from 'react';
import axios from 'axios';
import {DataGrid,gridCheckboxSelectionColDef } from '@material-ui/data-grid'
import { Redirect,Link} from 'react-router-dom';
var setinstitution =[];
var setInst = [];
export class Mrhome extends React.Component{
   
    fillInstitution(){
        axios.post("http://localhost:3001/forInstitution").then((response)=>{
           console.log(response.data);
           setinstitution=response.data
           })
    }
    componentDidMount(){
        this.fillInstitution();
    }
    render() {
    
      return(
        <div style = {{display: 'flex', height: '100%'}}>
            <div style={{ flexGrow: 1 }}>
                <table class = "stripped table">
                 <tr>
                    <th>Institution Name</th>
                    <th>No.of Members</th>
                    <th>No.of Task Assigned</th>
                    <th>No.of Task Completed</th>
                    <th>OverDue Task</th>
                 </tr>
                    {setinstitution.map((inst)=>{
                    <tr> <td>{inst.inst_name}</td>
                    
                    <td>task</td>  <td>completed</td> <td>assigned</td>  <td>overdue</td>
                    </tr>
                    }) } 
                    
                    </table>
            </div>
        </div>
      );
    };
}
